import React, { useEffect, useState } from "react";
import axios from "axios";
import { useTranslation } from "react-i18next";
import { Navbar, Container,  Nav } from "react-bootstrap";

const ShowBranchDetails = (props) => {
	const { t } = useTranslation();
   const branchNameId =atob(props.match.params.id);
   // atob(branchNameId)
   const [loading, setLoading]= useState(true); 
   const [data, setData]= useState([])
   useEffect(()=>{

      axios.get(`/api/GetBranchForShow/${branchNameId}`).then(res => {
         if(res.data.status === 200){
            setData(res.data.data);
         }
         setLoading(false);
       });
      

   },[])
   var viewShow_HTMLTABLE="";
   if(loading){
      return <h4>{t('loading')}</h4>
  }else{
      viewShow_HTMLTABLE = 
      data.map((item,i)=>{
          return (
              <div className="col-xl-4 col-lg-6 col-sm-6" key={i}>
               {item.BrancheName}
              </div>
          )
      })
  }
   
   return (
      <Navbar bg="success" variant="dark">
          {data.map((item,i)=>{
         <Navbar.Brand href="#home">{item.BrancheName}</Navbar.Brand>
          }) }
         <Nav className="me-auto">
            <Nav.Link href="#home">Home</Nav.Link>
            <Nav.Link href="#features">Features</Nav.Link>
            <Nav.Link href="#pricing">Pricing</Nav.Link>
         </Nav>
         
      </Navbar>
      // <div className="row justify-content-center  h-200 align-items-center h-80">
      // </div>
   );

};

export default ShowBranchDetails;
